public class Ejemplo_For {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(int alumnos=0; alumnos<10; alumnos++) {
			
			for(int j=0;j<10;j++) {
			
			System.out.println("hola alumnos " + j);
			
			}
		}
		System.out.println("has salido del bucle");
	}

}
